import { useEffect, useState } from "react";

export default function MyCart(props) {
    const items = props.purchaseItem;
    const [total, setTotal] = useState(0);

    useEffect(() => {
        const calculatedTotal = items.reduce((sum, item) => sum + item.price, 0);
        setTotal(calculatedTotal);
    }, [items]);

    const handlePlaceOrder = () => {
        // Handle placing the order here
        alert("Order placed!");
    }

    return (
        <div className="container">
            <div className="row">
                <div className="col-sm-6">
                    <h2 className="text-primary">Shopping Cart</h2>
                    <div className="card">
                        {items.map((choco, index) => (
                            <div className="mt-3" key={index}>
                                <img src={choco.img} style={{ width: "150px" }} alt={choco.name} />
                                <br /> {choco.name}
                                <br /> {choco.price}
                            </div>
                        ))}
                    </div>
                </div>
                <div className="col-sm-6">
                    <h2 className="text-primary">Your Order</h2>
                    <table className="table">
                        <thead>
                            <tr>
                                <th>Product</th>
                                <th>Subtotal</th>
                            </tr>
                        </thead>
                        <tbody>
                            {items.map((choco, index) => (
                                <tr key={index}>
                                    <td>{choco.name}</td>
                                    <td>{choco.price}</td>
                                </tr>
                            ))}
                            <tr>
                                <td colSpan={2}>
                                    <strong>Total</strong>
                                </td>
                            </tr>
                            <tr>
                                <td colSpan={2}>
                                    {total}
                                </td>
                            </tr>
                            <tr>
                                <td colSpan={2}>
                                    <button className="btn btn-outline-dark" onClick={handlePlaceOrder}>
                                        Place the Order
                                    </button>
                                </td>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
        </div>
    );
}
